# 和可被 K 整除的子数组  
# 题目难度 Medium
# 给定一个整数数组 A，返回其中元素之和可被 K 整除的（连续、非空）子数组的数目。

# 输入：A = [4, 5, 0, -2, -3, 1], K = 5
# 输出：7
# 解释：
# 有 7 个子数组满足其元素之和可被 K = 5 整除：
# [4, 5, 0, -2, -3, 1], [5], [5, 0], [5, 0, -2, -3], [0], [0, -2, -3], [-2, -3]


class Solution:
    def subarraysDivByK(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        """
        pre_sum, res = 0, 0
        dic = {0: 1}

        for val in A:
            pre_sum = (pre_sum + val) % K
            if pre_sum in dic:
                res += dic[pre_sum]
            dic[pre_sum] = dic.get(pre_sum, 0) + 1
        print(dic)
        return res


test = Solution()
import time
startTime = time.time()
print(test.subarraysDivByK([4, 5, 0, -2, -3, 1],5))
